@LettersAndShit Yet Man City won the title barely playing a striker. 

I get the dm position is a problem but almost no team in history who won a title had a perfect team. 

It's the managers job to make the most of what he has and work around what he doesn't have.

@LettersAndShit Penalties are a terrible way to judge a keeper. 

How many pens will he face in a season? How many open play shots will he face? 

Loon at Chelsea, they changed their keeper for penalties during the Villareal game, didn't change him as the first choice though.

@ManUtd Sign Neves or we riot. 

Absolutely no reason a club with our turnover shouldn't be sorted that DM position in this window.

Show some ambition and get it done.

